column13:
- Expensive ink cartridge;
 - There are very few sheets of paper in the paper compartment for printing, I think about 5;
 - Setting up scanning via Wi-Fi is a bit time-consuming, as it depends on the internet signal. It takes time to open the HP website, you have to open an account, the signal is weak at the printer and then the printer doesn't work;
 - Configuration via USB is a little faster, but to print you still have to access the application and the application could have fewer steps.
 - Scanning could be simple, via Windows.
